  if countPrevStation ge 2 then do;
    if prevTrackTravelTime gt 0 then do;
      expectedNextTrain2Time=strip(put(2.0+ceil(prevTrackTravelTime/60.0),8.0))||' minutes';
    end;
    else do;
      expectedNextTrain2Time='4 minutes';
    end;
  end;
end;

